import sys

def count_good_partitions(nums):
    """
    Counts the number of good partitions of an array.

    Args:
        nums: A list of positive integers.

    Returns:
        The number of good partitions of nums.
    """
    if not nums:
        return 0

    count = 0
    for i in range(1, 1 << len(nums)):
        subset = []
        for j in range(len(nums)):
            if (i >> j) & 1:
                subset.append(nums[j])

        if len(subset) == 0:
            continue

        is_good = True
        for k in range(len(subset)):
            for l in range(k + 1, len(subset)):
                if subset[k] > subset[l]:
                    is_good = False
                    break
            if not is_good:
                break

        if is_good:
            count += 1

    return count

